import './Estante.css'

function Estante(props){
 var c = props.conteudo;
 var heightRed = window.innerHeight/ 953;
 var widthRed = window.innerWidth/ 1869;
 var localX = c.x * widthRed;
 var localY = c.y * heightRed;
 var tamanhoW = c.width * widthRed;
 var tamanhoH = c.height * heightRed;
if(props.escolhido){
  
  return(
    <div className='EstanteEscolhida' key={props.i} style={{left: localX, top: localY, rotate: c.rotate+"deg", height: tamanhoH, width: tamanhoW}}>
    </div>  
  )
}else{
  return(

    <div className='Estante' key={props.i} style={{left: localX, top: localY, rotate: c.rotate+"deg", height: tamanhoH, width: tamanhoW}}>
    </div>  
  )
}
 
}
export default Estante
